import React from 'react';
import CatFacts from './components/CatFacts';       // Default import
import RandomCatFact from './components/RandomCatFact';  // Default import
import AddCatFact from './components/AddCatFact';       // Default import

function App() {
  return (
    <div>
      <h1>Cat Fact Tracker</h1>
      <RandomCatFact />
      <CatFacts />
      <AddCatFact />
    </div>
  );
}

export default App;
